import { render } from "@testing-library/react";
import { React, useState, useEffect } from "react";
import Card from "./Card";
import "./index.css";

const Necas = ({ titles }) => {
  return (
    <div className="grid-container">
      {titles.Search.map((t) => {
        return <Card key={t.imdbID} title={t.Title} />;
      })}
    </div>
  );
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
